Опис:
Удобный подъезд, недалеко от центральной части города в парковой зоне «Снопковский». Паркоместо возле дома.
Железобетонный каркас;
Перекрытие – монолитное железобетонное;
Наружные стены из глиняного красного кирпича с последующим утеплением;
Бронированные входные двери;
Окна деревянные с стеклопакетом;
Штукатурка стен;
Цементная стяжка под чистовой пол;
Отопление – индивидуальное поквартирное от двухконтурного котла в кухне, современные радиаторы;
Круглосуточное водоснабжение;
Высота потолков: 3,00 м;
Лестницы монолитные железобетонные;
Гидравлический лифт;
Счетчики: водо-, электро - и газоснабжения;
Электропроводка из медного провода без розеток, выключателей, светильников.
